/// Zero-allocation container for zero, one, or many items
#[derive(Debug, Clone, PartialEq, Eq)]
pub enum ZeroOneOrMany<T> {
    /// No items
    Zero,
    /// Exactly one item
    One(T),
    /// Multiple items (stack-allocated when possible)
    Many(Vec<T>),
}

impl<T> ZeroOneOrMany<T> {
    /// Create a new ZeroOneOrMany from a single item
    #[inline(always)]
    pub fn one(item: T) -> Self {
        Self::One(item)
    }

    /// Create a new ZeroOneOrMany from multiple items
    #[inline(always)]
    pub fn many(items: Vec<T>) -> Self {
        match items.len() {
            0 => Self::Zero,
            1 => Self::One(items.into_iter().next().unwrap()),
            _ => Self::Many(items),
        }
    }

    /// Iterator over items
    pub fn iter(&self) -> ZeroOneOrManyIter<T> {
        ZeroOneOrManyIter::new(self)
    }
}

/// Iterator for ZeroOneOrMany
pub struct ZeroOneOrManyIter<'a, T> {
    inner: ZeroOneOrManyIterInner<'a, T>,
}

enum ZeroOneOrManyIterInner<'a, T> {
    Zero,
    One(Option<&'a T>),
    Many(std::slice::Iter<'a, T>),
}

impl<'a, T> ZeroOneOrManyIter<'a, T> {
    fn new(container: &'a ZeroOneOrMany<T>) -> Self {
        let inner = match container {
            ZeroOneOrMany::Zero => ZeroOneOrManyIterInner::Zero,
            ZeroOneOrMany::One(item) => ZeroOneOrManyIterInner::One(Some(item)),
            ZeroOneOrMany::Many(items) => ZeroOneOrManyIterInner::Many(items.iter()),
        };
        Self { inner }
    }
}

impl<'a, T> Iterator for ZeroOneOrManyIter<'a, T> {
    type Item = &'a T;

    fn next(&mut self) -> Option<Self::Item> {
        match &mut self.inner {
            ZeroOneOrManyIterInner::Zero => None,
            ZeroOneOrManyIterInner::One(item) => item.take(),
            ZeroOneOrManyIterInner::Many(iter) => iter.next(),
        }
    }
}

